--
-- Table structure for table `mrp_material_demands`
--

DROP TABLE IF EXISTS `mrp_material_demands`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `mrp_material_demands` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `source_mrp_code` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '来源MRP编号',
  `material_code` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '物料编码',
  `material_name` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '物料名称',
  `material_unit` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT '件' COMMENT '单位',
  `source_type` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '需求来源',
  `demand_qty` decimal(15,4) DEFAULT '0.0000' COMMENT '需求数量',
  `required_date` date DEFAULT NULL COMMENT '需求日期',
  `current_stock` decimal(15,4) DEFAULT '0.0000' COMMENT '当前库存',
  `in_transit_stock` decimal(15,4) DEFAULT '0.0000' COMMENT '在途库存',
  `in_production_stock` decimal(15,4) DEFAULT '0.0000' COMMENT '在制库存',
  `production_reserved_stock` decimal(15,4) DEFAULT '0.0000' COMMENT '生产预扣库存',
  `to_be_shipped_stock` decimal(15,4) DEFAULT '0.0000' COMMENT '待发货库存',
  `suggested_qty` decimal(15,4) DEFAULT '0.0000' COMMENT '建议数量',
  `adjusted_qty` decimal(15,4) DEFAULT '0.0000' COMMENT '调整数量',
  `execute_qty` decimal(15,4) DEFAULT '0.0000' COMMENT '执行数量',
  `level` int DEFAULT '1' COMMENT 'BOM层级',
  `output_process` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '产出工序',
  `component_source` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '子件来源（自制/外购）',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_material_demand` (`source_mrp_code`,`material_code`,`level`),
  KEY `idx_source_mrp_code` (`source_mrp_code`),
